import "./Navbar.scss";
import Logo from "./Logo";
function Navbar(){
    return(
        <div className="navbar">
           <div class="topnav">
             <a class="active" href="#home">Home</a>
             <a href="#news">News</a>
             <a href="#contact">Contact</a>
             <a href="#about">About</a>
           </div>

        </div>
    )
}

export default Navbar;
